import React from 'react'

const Todo = ({ todo, handleDelete }) => {
    return (
        <div
            style={{
                display: 'flex',
            }}
        >
            <p>{todo.task}</p>
            <button onClick={() => handleDelete(todo.id)}>X</button>
        </div>
    )
}

export default Todo
